import { getAPI } from "../helpers/helpers";

export default async function fetchProductSearch(
    searchQuery: string = ""
): Promise<Response> {
  return getAPI(`/products/search/${searchQuery.split(' ').join('+')}`)
  console.log(getAPI(`/products/search/${searchQuery.split(' ').join('+')}`))
}
